      <Searchdiv> 무엇을 검색하시겠습니까 ?</Searchdiv>
    </div>
  );
}
const AppBardiv = styled.div`
background-color: black;
color:white;
font-size:50px;
`;

const Searchdiv = styled.div`

`;
